import { useRef } from 'react';

export default function Blog() {
    const InputRef=useRef<HTMLAllCollection>(null)
    const rendrefocus=()=>{
        if(InputRef.current){
            InputRef.current.focus()
            console.log('hii')
        }
    }
    return(
        <>
        <input type="text" ref={InputRef} placeholder='entrer text' required/>
        <button onClick={rendrefocus}>click</button>
        
        
        </>
    )
}
